using System;
using System.Drawing;
using System.IO;

namespace Radar
{
    internal static class ImagesBase64
    {
        internal static readonly Image Settings;
        private const string settings = "";

        internal static readonly Image Close;
        private const string close = "";

        internal static readonly Image Icon;
        private const string icon = "";

        static ImagesBase64()
        {
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(settings)))
            {
                Settings = Image.FromStream(memoryStream);
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(close)))
            {
                Close = Image.FromStream(memoryStream);
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(icon)))
            {
                Icon = Image.FromStream(memoryStream);
            }
        }
    }
}